tests.code:
request(server)
    .post(path)
    .set('Authorization', `Bearer ${token}`)
    .send(neuesSpiel)
    .expect(shared_1.HttpStatus.CREATED)
    .end((error, response) => {
    if (error) {
        return done(error);
    }
    const { location } = response.header;
    location.should.be.not.empty;
    // UUID: Muster von HEX-Ziffern
    const indexLastSlash = location.lastIndexOf('/');
    const idStr = location.substring(indexLastSlash + 1);
    idStr.should.match(
    /* eslint-disable-next-line max-len */
    /[\dA-Fa-f]{8}-[\dA-Fa-f]{4}-[\dA-Fa-f]{4}-[\dA-Fa-f]{4}-[\dA-Fa-f]{12}/u);
    done();
});

